// NavBar.js

import React from 'react';
import { Link } from 'react-router-dom';
import avatar from "../assets/group.png";
import styles from '../styles/Username.module.css';


function NavBar() {
  return (
    <nav className="bg-gray-800 p-4">
         <div className="profile flex justify-center py-4">
              <img src={avatar} className={styles.group_img} alt="avatar" />
            </div>
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-white font-bold text-xl">Digitalflake Admin</Link>
        <div>
          <Link to="/" className="text-gray-300 mx-4">LogOut</Link>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
